import React from 'react';
import AdvancedChat from './AdvancedChat';
import BasicChat from './BasicChat';
import ReportAssistant from './ReportAssistant';

function App() {
  return (
    <div>
      <h1>MERN Frontend Running</h1>
      <AdvancedChat />
      <BasicChat />
      <ReportAssistant />
    </div>
  );
}

export default App;
